local Tables = {}
local Names = {
	ScreenCull = "",
	network = "",
	effects = "",
	vector = "",
	camera = "",
	input = "",
	sound = ""
}

for i, v in pairs(getscripts()) do
	if v.ClassName == "ModuleScript" and Names[v.Name] ~= nil then
		Tables[v.Name] = require(v)
	end
end

Tables["char"] = debug.getupvalue(Tables.effects.muzzleflash, 2)
Tables["replication"] = debug.getupvalue(Tables.camera.setspectate, 1)
Tables["hud"] = debug.getupvalue(Tables.char.setmovementmode, 10)
Tables["gamelogic"] = debug.getupvalue(Tables.char.setsprint, 1)
Tables["input"] = debug.getupvalue(Tables.gamelogic.controllerstep, 2)

for i, v in pairs(Tables) do
	getgenv()[i] = v
	for o, b in pairs(v) do
		if not getgenv()[o] and type(b) == "function" then
			getgenv()[o] = b
		end
	end
end

for i, v in pairs(getgc(false)) do -- Iray upvalue and gun data getter
	if getinfo(v).name == "loadgun" then
		local gunbob = debug.getupvalue(v, 57)
		local gunsway = debug.getupvalue(v, 58)
		local getModifiedData = debug.getupvalue(v, 1)
		debug.setupvalue(v, 1, function(data, mods)
			data = getModifiedData(data, mods)
			setreadonly(data, false)
			if toggles.NoRecoil then
				data["aimcamkickspeed"] = 9999999
				data["camkickspeed"] = 9999999
				data["modelkickspeed"] = 9999999
			end
			if toggles.NoSpread then
				data["hipfirespreadrecover"] = 9999999
				data["hipfirespread"] = 9999999
			end
			return data
		end)
		break
	end
end

